const Footer = () => {
    return ( 
          <div className="footer">
              <div class="footer-top">
              <div className="container">
               <div className="row">
               <div className="col-lg-3 col-md-6 footer-contact">
               <h3><span className="dojo">DOJO</span></h3>
              </div>
              </div>
              </div>
              </div>
          </div>
     );
}
 
export default Footer;
